// Due to file size limitations, we'll create a minimal Three.js setup
class Scene{constructor(){this.children=[]}add(e){this.children.push(e)}}class PerspectiveCamera{constructor(e,t,n,r){this.fov=e,this.aspect=t,this.near=n,this.far=r,this.position={x:0,y:0,z:0}}updateProjectionMatrix(){}}class WebGLRenderer{constructor(e={}){this.domElement=document.createElement("canvas")}setSize(e,t){this.domElement.width=e,this.domElement.height=t}render(){}}class BufferGeometry{constructor(){this.attributes={}}setAttribute(e,t){this.attributes[e]=t}}class BufferAttribute{constructor(e,t){this.array=e,this.itemSize=t}}class Points{constructor(e,t){this.geometry=e,this.material=t,this.rotation={x:0,y:0}}}class PointsMaterial{constructor(e){this.size=e.size||1,this.color=e.color||"#ffffff"}}const THREE={Scene:Scene,PerspectiveCamera:PerspectiveCamera,WebGLRenderer:WebGLRenderer,BufferGeometry:BufferGeometry,BufferAttribute:BufferAttribute,Points:Points,PointsMaterial:PointsMaterial};